	},
	media: {
		width: '30%',
		height: 0,
		paddingTop: '56.25%' // 16:9
	}
})); */

const FinishSelected = ({
  selected,
  average,
  max,
  min,
  setescondidoinicial,
  category,
}) => {
  const idcliente = "abcdef";
  const sku = useGetSku(idcliente);
  const skufinal = sku.data;
  const newJson1 = [];
  skufinal.forEach((event) => {
    event.res !== true
      ? newJson1.push({
          value: event.sku,
          label: event.sku,
        })
      : null;
  });

  // Defino mi arreglo final para enviar a la base de datos

  const [final, setfinal] = useState({
    sku: "",
    average,
    max,
    min,
    keyword: category,
    data: selected,
  });

  const handleInputChange = (event) => {
    setfinal({
      ...final,
      sku: event.value,
    });
  };

  const updatesku = async () => {
    console.log("A grabar: ", final);

    UpdateSku(final)
      .then(
        await Swal.fire({

          icon: "success",
          title: "Your work has been saved",
          showConfirmButton: false,
          timer: 1500,
        })
      )
      .then((result) => {
        setescondidoinicial({ escondidoinicial: true });
      });
  };

  return (
    <>
       <Grid item lg={6} md={6} sm={6} xs={6}>
        <Select width="200px" options={newJson1} onChange={handleInputChange} />
		</Grid>
        <Button onClick={updatesku} variant="contained" color="primary">
          Finish an Save
        </Button>

    </>
  );
};

export default FinishSelected;
